=head1 DESCRIPTION

The result from the inspection of the web request for a valid
C<CAPTCHA> token.

=head1 ATTRIBUTES


=head2 FailureReason => Str

The reason for failure, populated when the evaluation of the token
fails.


=head2 ResponseCode => Int

The HTTP response code indicating the status of the C<CAPTCHA> token in
the web request. If the token is missing, invalid, or expired, this
code is C<405 Method Not Allowed>.


=head2 SolveTimestamp => Int

The time that the C<CAPTCHA> was last solved for the supplied token.



